@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

atm:ATM a owl:Class .
atm:Withdrawal a owl:Class .
atm:Bank a owl:Class .

atm:dispensesMoney a owl:ObjectProperty ;
  rdfs:domain atm:ATM ;
  rdfs:range atm:Withdrawal .

atm:processesWithdrawal a owl:ObjectProperty ;
  rdfs:domain atm:Bank ;
  rdfs:range atm:Withdrawal .

atm:acceptsWithdrawal a owl:ObjectProperty ;
  rdfs:domain atm:Bank ;
  rdfs:range atm:Withdrawal .

# If the ATM dispenses money, then the withdrawal is processed and accepted by the bank
atm:ATMDispensesMoneyShape a owl:Axiom ;
  owl:propertyChainAxiom ( atm:dispensesMoney atm:processesWithdrawal atm:acceptsWithdrawal ) ;
  owl:equivalentProperty atm:dispensesMoney .

# If the withdrawal is processed and accepted by the bank, then the ATM dispenses money
atm:BankProcessesAndAcceptsWithdrawalShape a owl:Axiom ;
  owl:propertyChainAxiom ( atm:processesWithdrawal atm:acceptsWithdrawal ) ;
  owl:equivalentProperty atm:dispensesMoney .
